jQuery.sap.declare("sap.zen.crosstab.RowHeaderArea");jQuery.sap.require("sap.zen.crosstab.BaseArea");jQuery.sap.require("sap.zen.crosstab.rendering.RenderingConstants");
sap.zen.crosstab.RowHeaderArea=function(c){"use strict";sap.zen.crosstab.BaseArea.call(this,c);this.sAreaType=sap.zen.crosstab.rendering.RenderingConstants.TYPE_ROW_HEADER_AREA;this.iRenderStartRow=0;this.iRenderRowCnt=0;this.bLastPageLoaded=false;};
sap.zen.crosstab.RowHeaderArea.prototype=jQuery.sap.newObject(sap.zen.crosstab.BaseArea.prototype);
sap.zen.crosstab.RowHeaderArea.prototype.renderArea=function(r){var c="sapzencrosstab-RowHeaderArea";if(this.oCrosstab.getPropertyBag().isMobileMode()){c+=" sapzencrosstab-MobileHeaderSeparator";}this.renderContainerStructure(r,c,this.oCrosstab.isVCutOff(),false);};
sap.zen.crosstab.RowHeaderArea.prototype.getSelectedCellsBySelectionCoordinates=function(r,c){var C=this.oDataModel.getCellWithSpan(r,c,true);var R={};if(C){R[C.getId()]=C;var s=C.getRowSpan();var S=C.getCol()+1;var a=this.getColCnt()-S;var b=0;var d=null;for(var i=0;i<s;i++){b=C.getRow()+i;d=this.oDataModel.getCellsByRow(b,S,a);for(var j=0;j<d.length;j++){R[d[j].getId()]=d[j];}}return R;}};
sap.zen.crosstab.RowHeaderArea.prototype.getSelectedCellsByDataSelection=function(d){var r={};var s=0;var e=this.getColCnt();var R=d.getRow();for(var c=s;c<e;c++){var C=this.oDataModel.getCellWithSpan(R,c);r[C.getId()]=C;}return r;};
sap.zen.crosstab.RowHeaderArea.prototype.getRenderedCellsByCol=function(c){var i=0;var C=null;var o={};var m=this.iRenderStartRow+this.iRenderRowCnt;for(i=this.iRenderStartRow;i<=m;i++){C=this.oDataModel.getCellWithRowSpan(i,c,true);if(C){o[C.getId()]=C;}}return o;};
